import React from 'react';

export function ShowList() {
  const data = Array.from({length: 10}, () => Math.floor(Math.random() * 10));
  console.log(data);
  return (
    <ul role="list" className="grid grid-cols-2 gap-x-4 gap-y-8 sm:grid-cols-4 sm:gap-x-6 lg:grid-cols-6 xl:gap-x-8">
      {data.map((d: number) => (
        <li key={d} className="relative p-4 bg-gray-800 hover:bg-gray-700 cursor-pointer transition-colors duration-200 rounded">
          <div className="focus-within:ring-2 group block w-full overflow-hidden h-46">
            <div className="h-full w-full bg-red-100 rounded-xl">

            </div>
          </div>
          <p className="mt-4 block text-xl font-bold text-gray-100 truncate pointer-events-none">Podcast {d} title</p>
          <p className="mt-1 block text-md font-medium text-gray-500 pointer-events-none">Publisher</p>
        </li>
      ))}
    </ul>    
  );
}
